import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import logo from './logo.svg';
import './App.css';
import Navbar from './components/Navbar';
import Page from './LandingPage/Page';
import 'bootstrap/dist/css/bootstrap.min.css';
import Appointment from './LandingPage/Appointment';
import GetAppointments from './LandingPage/pages/GetAppointments';

function App() {
  return (
    <Router>
      <div>
        <Navbar />
        {/* Use Routes instead of Switch for v6 */}
        <Routes>
          {/* Home Page */}
          <Route path="/" element={<Page />} />

          {/* Appointment Page */}
          <Route path="/appointment" element={<Appointment />} />

          {/* Admin Page (separate page for GetAppointments) */}
          <Route path="/admin" element={<GetAppointments />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
